import logo from "./logo.svg";
import "./App.css";

function App() {
  const paymentCall = () => {
    fetch("http://localhost:4000/payment", {
      headers: {
        "Content-type": "application/json",
      },
      method: "POST",
      body: JSON.stringify({
        userName: "Aniket",
        userId: "123456",
        userEmail: "abns@jhafg",
        userPaymentMethod: "Card",
      }),
    })
      .then((res) => {
        return res.json();
      })
      .then((res) => console.log(res))
      .catch((error) => {
        console.log(error);
      });
  };
  return <div className="container"></div>;
}

export default App;
